{
    "Reasoning": "Current lifecycle analyses show that modern U.S. corn-ethanol returns slightly more energy than is consumed in growing, harvesting, transporting and refining it (energy return on investment ≈1.2–1.5). Sugar-cane ethanol has a much higher positive balance. Therefore, it is not correct that ethanol universally requires more energy to make than it yields; it generally provides a net, though sometimes modest, energy gain.",
    "Answer": "False",
    "Confidence": 0.7
}

{
    "Reasoning": "The term “property tax” is generic and applies to all kinds of real property—land, commercial buildings, apartments, factories, etc. “House tax” is usually used more narrowly for the municipal tax levied specifically on residential houses. Thus, while a house tax is one form of property tax, the two terms are not strictly identical.",
    "Answer": "False",
    "Confidence": 0.65
}

{
    "Reasoning": "Individuals can indeed feel pain in body parts that are no longer present (phantom limb pain) or that are paralyzed, because the nervous system and brain regions responsible for processing pain signals may still fire despite the lack of input from the original tissues.",
    "Answer": "True",
    "Confidence": 0.83
}

{
    "Reasoning": "Harry Potter and the Escape from Gringotts at Universal Orlando uses a steel coaster track with launch sections and drops, blended with motion-base vehicles, 3-D projection, and dark-ride scenes. Because the ride system is fundamentally built on a roller-coaster track and is classified by the park and manufacturers as a steel roller coaster/dark-ride hybrid, it is considered a roller coaster ride (albeit one with additional show elements).",
    "Answer": "True",
    "Confidence": 0.78
}

{
    "Reasoning": "Hydroxyzine comes in two salt forms: hydroxyzine hydrochloride (HCl) and hydroxyzine pamoate (PAM). The salts affect the physical formulation (tablets, capsules, syrup, injectable) and the milligram strength required to deliver an equivalent amount of hydroxyzine base (e.g., 25 mg HCl ≈ 30 mg PAM). Pharmacologically, once absorbed both release the same active drug, so therapeutic effects and side-effect profiles are essentially the same; the main differences are the salt, available dosage forms, and minor differences in absorption/onset.",
    "Answer": "Yes — the difference is the salt form (HCl vs pamoate), not the active drug effect.",
    "Confidence": 0.86
}

{
    "Reasoning": "Barq’s Root Beer is owned and distributed by The Coca-Cola Company, not PepsiCo. Therefore it is not a Pepsi product.",
    "Answer": "False",
    "Confidence": 0.9
}

{
    "Reasoning": "In English there are several accepted words in major dictionaries whose letter “q” is not followed by “u,” such as “qat,” “qi,” and “faqir.” Therefore, such words do exist.",
    "Answer": "True",
    "Confidence": 0.81
}

{
    "Reasoning": "All Canadian provinces and territories allow visitors to drive with a valid U.S. driver’s license for a limited period (usually up to 90 days to 6 months, depending on the province). For short-term travel, no additional Canadian license is required; you must simply carry your U.S. license and obey local laws. Long-term residents, however, must exchange their U.S. license for a provincial one after the allowed visitor period.",
    "Answer": "True",
    "Confidence": 0.84
}

{
    "Reasoning": "In the FIFA World Cup (men’s and women’s), the two teams that lose in the semi-finals meet in an additional match—commonly called the “third-place play-off” or “consolation final”—to determine who finishes third. This fixture has been a standard part of the tournament format for many decades.",
    "Answer": "True",
    "Confidence": 0.8
}

{
    "Reasoning": "The Netflix series \"Bloodline\" was created by Todd A. Kessler, Glenn Kessler, and Daniel Zelman as an original drama. While it draws on themes common to many real families—secrets, crime, and guilt—its characters, plot, and events are fictional and not adapted from any specific true story.",
    "Answer": "False",
    "Confidence": 0.83
}

{
    "Reasoning": "Shower gels are designed primarily to cleanse skin. They often contain stronger or different surfactant blends and lack the conditioning agents, anti-static polymers, and pH adjustments that shampoos include for hair and scalp health. Using shower gel on hair once in a while will usually not cause serious damage, but regular use can strip natural oils, leave hair dry or tangled, and potentially irritate the scalp. Therefore, it is generally considered a poor practice (i.e., ‘bad’) compared with using a product formulated as shampoo.",
    "Answer": "True",
    "Confidence": 0.65
}

{
    "Reasoning": "Although primarily associated with digestion and metabolism, the liver also removes toxic substances from the blood and excretes waste products such as bilirubin by secreting them into bile. Because of this waste-elimination function, many biology texts list the liver as one of the accessory organs of the human excretory system along with the kidneys, lungs, and skin.",
    "Answer": "True",
    "Confidence": 0.63
}

{
    "Reasoning": "Fantastic Beasts and Where to Find Them is set in 1926, roughly 70 years before the events of the main Harry Potter series, and explores earlier events in the Wizarding World. Because it takes place chronologically before the original story while existing within the same fictional universe, it is classified as a prequel.",
    "Answer": "True",
    "Confidence": 0.85
}

{
    "Reasoning": "The CW officially renewed The Vampire Diaries for an eighth season, which ultimately aired from October 2016 to March 2017. Therefore, relative to the question of whether a Season 8 would exist, the answer is yes—Season 8 was produced and released.",
    "Answer": "True",
    "Confidence": 0.82
}

{
    "Reasoning": "Writer-director Bryan Bertino has said he drew inspiration from several incidents—the Manson family murders, the 1981 Keddie Cabin murders, and his own childhood experience of strangers knocking at his door—but the plot and characters of the 2008 film “The Strangers” are products of fiction. It is marketed as “inspired by true events,” yet it is not a direct or faithful retelling of any single real crime, so it is not truly “based on a true story.”",
    "Answer": "False",
    "Confidence": 0.74
}

{
    "Reasoning": "The Russell Group is a consortium of 24 leading UK research-intensive universities. Durham University was among the institutions added when the group expanded in 2012, and it remains a full member today.",
    "Answer": "True",
    "Confidence": 0.87
}

{
    "Reasoning": "Fox’s medical drama ‘The Resident’ finished airing its Season 6 finale on January 17, 2023, and the network has since cancelled the series. Therefore the current season is already completed and no further episodes are scheduled.",
    "Answer": "True",
    "Confidence": 0.75
}

{
    "Reasoning": "Magnesium citrate is the magnesium salt of citric acid. In the compound, the acidic hydrogen atoms of citric acid have been replaced by magnesium ions, producing the citrate anion (C6H5O7​3–). Therefore, the finished product contains citrate, not free citric acid itself. Lay descriptions may mention that it is ‘made from citric acid,’ but chemically it no longer contains citric acid in its protonated form.",
    "Answer": "False",
    "Confidence": 0.71
}

{
    "Reasoning": "In a spark-ignition internal-combustion engine, the spark plug produces the electrical spark that ignites the air-fuel mixture in each cylinder every cycle. Continuous ignition is required for every power stroke, so if the spark plug stops firing the mixture will not ignite and the engine will stall. Therefore, functioning spark plugs are essential to keep such an engine running.",
    "Answer": "True",
    "Confidence": 0.78
}

{
    "Reasoning": "Although both are sleeveless outer garments worn over the shoulders, a cloak is typically full-length (often reaching below the knees and sometimes including a hood), while a cape is shorter and usually ends at or above the hips or mid-thigh. Because of these functional and stylistic differences, they are considered distinct garments rather than the same thing.",
    "Answer": "False",
    "Confidence": 0.77
}

{
    "Reasoning": "The U.S. Department of State imposes a mandatory processing fee for filing Form DS-4079 and taking the oath of renunciation. Since 2014 that fee has been set at $2,350 (with very limited grounds for a waiver), so renouncing U.S. citizenship is not free.",
    "Answer": "Yes, it costs money",
    "Confidence": 0.86
}

{
    "Reasoning": "The Amazon Fire 7 is an inexpensive 7-inch color tablet that runs Fire OS and supports apps, video, web browsing, etc. The term “Kindle” normally refers to Amazon’s e-ink readers designed primarily for reading books. Although both are Amazon devices and you can read Kindle books on a Fire 7, they are built on different hardware platforms with different screens and purposes, so they are not the same device.",
    "Answer": "False",
    "Confidence": 0.86
}

{
    "Reasoning": "Wisconsin’s alcohol laws create an explicit exception to the 21-year-old drinking age: a person under 21 may legally possess and consume alcoholic beverages if they are with a parent, legal guardian, or spouse who is of legal drinking age and the alcohol-serving establishment (or private host) allows it. The supervising adult must give consent and be present the entire time. Outside those specific circumstances, under-21 drinking remains illegal.",
    "Answer": "True",
    "Confidence": 0.75
}

{
    "Reasoning": "In all birds, feathers are epidermal appendages that develop from follicle structures where the epidermis invaginates around a dermal papilla. Penguins, though specialized for an aquatic lifestyle, are still birds and their plumage follows the same developmental origin. Therefore, the feathers of penguins arise from the epidermis.",
    "Answer": "True",
    "Confidence": 0.83
}

{
    "Reasoning": "Most manufacturers still recommend a short break-in period (usually the first 500–1,000 miles) during which you avoid full-throttle acceleration, high sustained RPM, and heavy loads. This allows piston rings to seat properly, brake pads and rotors to mate, and other moving parts to wear in evenly. Although modern machining tolerances are tighter than in the past, following the maker’s guidelines can still improve long-term performance and longevity, so some form of break-in is advisable.",
    "Answer": "True",
    "Confidence": 0.62
}

{
    "Reasoning": "The Enchanted Forest theme park near Salem/Turner, Oregon temporarily closed during the height of the COVID-19 pandemic but reopened to the public in 2021. As of the latest available information (through late-2023), it continues to operate on its normal seasonal schedule (typically spring through Halloween, with a winter closure). There has been no announcement of a permanent shutdown.",
    "Answer": "True",
    "Confidence": 0.7
}

{
    "Reasoning": "The Indianapolis 500 is held at the Indianapolis Motor Speedway, whose grounds include the Brickyard Crossing Golf Course (with several holes located inside the track). Therefore, a golf course is indeed present at the Indy 500 venue.",
    "Answer": "True",
    "Confidence": 0.85
}

{
    "Reasoning": "In the main Marvel comic continuity, Wade Wilson (Deadpool) discovers that he fathered a biological daughter, Eleanor Camacho, with Carmelita Camacho (first revealed around Deadpool Vol. 3 #31, 2014). This confirms that Deadpool does indeed have a child in the comics.",
    "Answer": "True",
    "Confidence": 0.83
}

{
    "Reasoning": "Benson & Hedges remains an active cigarette brand owned and manufactured by major tobacco companies (e.g., Philip Morris International, British American Tobacco, and Altria in the U.S.). Although distribution has shrunk in some markets and certain product lines have been discontinued, the brand is still produced and sold in various countries today.",
    "Answer": "True",
    "Confidence": 0.75
}

{
    "Reasoning": "Federal income tax and Social Security tax are two separate taxes. Federal income tax is a general tax on an individual’s taxable income that funds a wide range of federal government programs. Social Security tax (part of FICA payroll taxes) is specifically earmarked to fund the Social Security program, which provides retirement, disability, and survivors’ benefits. Because they are imposed under different laws, appear as distinct line items on paychecks, and finance different government purposes, they are not the same.",
    "Answer": "False",
    "Confidence": 0.92
}

{
    "Reasoning": "In modern engine-management terminology the device that supplies the ECU with the engine’s rotational speed signal is the crankshaft position sensor. Because it delivers both position and rpm information, service literature often calls it the “engine speed sensor.” Although some vehicles may use other sensors (e.g., transmission speed sensors) for different speed readings, when the term is applied to the engine itself it is referring to the crankshaft sensor.",
    "Answer": "True",
    "Confidence": 0.7
}

{
    "Reasoning": "Indiana Jones and the Temple of Doom is set in 1935, while Raiders of the Lost Ark (the first film released) is set in 1936. Because the events of Temple of Doom occur chronologically before Raiders, it is considered a prequel within the series.",
    "Answer": "True",
    "Confidence": 0.86
}

{
    "Reasoning": "Avengers: Infinity War (2018) was designed as the first half of a two-part story. The direct continuation is Avengers: Endgame, released in 2019, which resolves the cliff-hanger ending of Infinity War. Therefore, there is indeed a ‘next part’ that follows Infinity War.",
    "Answer": "Yes – the sequel is Avengers: Endgame",
    "Confidence": 0.9
}

{
    "Reasoning": "The Toyota Highlander is classified as a midsize crossover SUV that has always used a unibody (car-based) construction derived from Toyota’s passenger-car platforms (e.g., K-platform, GA-K). A truck frame would imply a body-on-frame design like Toyota’s 4Runner or Tacoma, which the Highlander does not use.",
    "Answer": "False",
    "Confidence": 0.9
}

{
    "Reasoning": "Under U.S. copyright law (and similarly in many other jurisdictions), it is legal to record and release a cover of a previously published song as long as the covering artist obtains the appropriate mechanical (or compulsory) license and pays the statutory royalties to the copyright holder. Live performances of covers are also generally permitted provided the venue or promoter has the necessary performance licenses from the performing-rights organizations (ASCAP, BMI, SESAC, etc.). Therefore, covering a song is lawful when the required licenses and royalty payments are in place.",
    "Answer": "True",
    "Confidence": 0.71
}

{
    "Reasoning": "The electronegativity difference between carbon (≈2.5) and hydrogen (≈2.1) is only about 0.4. Bonds with such a small difference are generally classified as non-polar covalent. While there is a very slight polarity (carbon is marginally more electronegative), it is not enough for the bond to be considered appreciably polar in most chemical contexts. Therefore, carbon–hydrogen bonds are typically treated as non-polar rather than polar covalent.",
    "Answer": "False",
    "Confidence": 0.65
}

{
    "Reasoning": "The 2007 film “The Golden Compass” was intended to launch a trilogy, but its disappointing U.S. box-office performance, coupled with controversy, caused the studio to cancel further films. Although the remaining books were later adapted as the BBC/HBO television series “His Dark Materials,” no direct movie sequel to “The Golden Compass” was ever produced or released.",
    "Answer": "False",
    "Confidence": 0.85
}

{
    "Reasoning": "Columbus Day is one of the holidays designated by Congress under 5 U.S.C. § 6103. Federal offices close and most federal employees receive the day off, making it an official federal (national) holiday, even though some states and localities choose not to observe it or call it by another name.",
    "Answer": "True",
    "Confidence": 0.8
}

{
    "Reasoning": "New Balance Athletics, Inc. and Nike, Inc. are two distinct, independently owned sports-footwear and apparel companies. They have separate corporate headquarters, leadership, and branding, and they compete with one another in the marketplace. Therefore, they are not the same company.",
    "Answer": "False",
    "Confidence": 0.92
}

{
    "Reasoning": "Yes. For example, Interstate 10 runs from Santa Monica, California on the Pacific Ocean to Jacksonville, Florida on the Atlantic Ocean, so at least one Interstate Highway truly spans from one U.S. coast to the other.",
    "Answer": "True",
    "Confidence": 0.85
}

{
    "Reasoning": "Tomato purée is usually just strained, lightly cooked tomatoes with little or no added seasoning and a thicker consistency. Tomato sauce is typically cooked longer, thinned with liquid, and often contains added salt, herbs, onions, or other seasonings. Because of these differences in preparation, flavor, and texture, they are not considered the same product.",
    "Answer": "False",
    "Confidence": 0.8
}

{
    "Reasoning": "In English there are several valid words that contain no traditional vowel letters (a, e, i, o, u). Examples include interjections and onomatopoeic words such as “shh,” “psst,” “hmm,” and the adjective “nth.” Therefore at least in English, words can exist without a vowel letter, so the answer is yes.",
    "Answer": "True",
    "Confidence": 0.78
}

{
    "Reasoning": "The turkey vulture (Cathartes aura) is a well-known species of New World vulture native to much of the Americas, so it definitely exists.",
    "Answer": "True",
    "Confidence": 0.92
}

{
    "Reasoning": "A hole-in-one on a par-5 (called a “condor”) is extraordinarily rare but a handful of verified instances have been recorded in golf history—for example Larry Bruce’s ace on a 480-yard par-5 in 1962 and several later ones. Therefore the correct response to whether anyone has done it is yes.",
    "Answer": "True",
    "Confidence": 0.8
}

{
    "Reasoning": "Both the NFL’s New York Jets and New York Giants play their home games at MetLife Stadium in East Rutherford, New Jersey, a facility they co-own and share.",
    "Answer": "True",
    "Confidence": 0.9
}

{
    "Reasoning": "The U.S. Women’s National Team qualified for and participated in the most recent FIFA Women’s World Cup (2023). They have qualified for every Women’s World Cup to date, so they are indeed in the tournament.",
    "Answer": "True",
    "Confidence": 0.8
}

{
    "Reasoning": "No rule or inherent limitation prevents an African national side from winning the FIFA World Cup. Although none has done so yet, several have reached the quarter-finals and African football quality continues to improve. Therefore, it is indeed possible for an African team to win the tournament in the future.",
    "Answer": "True",
    "Confidence": 0.7
}

{
    "Reasoning": "A hammer is a heavy, hard object designed for striking. Any such object can be employed to inflict harm intentionally, so it can function as a weapon even though that is not its primary purpose.",
    "Answer": "True",
    "Confidence": 0.9
}

{
    "Reasoning": "Traditional fox hunting – pursuing a live fox with a pack of hounds – was banned in England and Wales by the Hunting Act 2004 (in force since 2005). While many hunt clubs still ride out, they are supposed to follow scent-laid ‘trail’ hunts or use other legal exemptions, not hunt live foxes. Therefore, in the legal sense, fox hunts as they formerly existed are no longer permitted in England, though related activities continue in modified form.",
    "Answer": "False",
    "Confidence": 0.55
}

{
    "Reasoning": "In the Army Service Uniform (ASU) regulations (AR 670-1 and DA Pam 670-1), the service coat (“ASU jacket”) is only authorized to be worn with the long-sleeve white dress shirt and a black necktie/neck tab. The short-sleeve ASU shirt is part of the Class B configuration and may not be worn under the service coat. Therefore, combining a short-sleeve ASU shirt with the ASU jacket is not permitted.",
    "Answer": "False",
    "Confidence": 0.82
}

{
    "Reasoning": "In Season 3 of The Vampire Diaries Damon and Elena admit growing feelings and share a couple of kisses, but they do not officially start a romantic relationship until Season 4 (after Elena becomes a vampire). Therefore, if “get together” means beginning an actual relationship, the answer is no for Season 3.",
    "Answer": "False",
    "Confidence": 0.8
}

{
    "Reasoning": "Line-backer Shaquem Griffin, who was born with amniotic band syndrome and had his left hand amputated as a child, reached the NFL in 2018 with the Seattle Seahawks and later spent time with the Miami Dolphins. He is the best-known example of an NFL player missing a hand, so the answer is effectively yes (though he announced his retirement in 2022, he was an NFL player).",
    "Answer": "True",
    "Confidence": 0.62
}

{
    "Reasoning": "“The Other Boleyn Girl” is a historical novel by Philippa Gregory that belongs to her larger sequence of Tudor-era books, often marketed as the “Tudor Court” (or more broadly, the “Plantagenet and Tudor”) series. Other titles in the same sequence include “The Constant Princess,” “The Boleyn Inheritance,” “The Queen’s Fool,” etc. Therefore, it is indeed part of a series rather than a standalone work.",
    "Answer": "True",
    "Confidence": 0.78
}

{
    "Reasoning": "“The Five Heartbeats” is the name of an R&B vocal group featured in the 1991 movie of the same name. Although the group was originally fictional, the name is indeed used within popular culture to refer to that (fictional) group, and cast members have occasionally performed together under the same name. Therefore, there is (at least fictionally) a group called The Five Heartbeats.",
    "Answer": "True",
    "Confidence": 0.77
}

{
    "Reasoning": "Mount Everest is geographically located within the Himalayan mountain range on the border of Nepal and the Tibet Autonomous Region of China, making it part of the Himalayas.",
    "Answer": "True",
    "Confidence": 0.97
}

{
    "Reasoning": "Under the National EMS Scope of Practice Model and in most U.S. states, IV therapy (initiating an intravenous line) is outside the standard scope of practice for an EMT-Basic. That skill is typically reserved for Advanced EMTs, EMT-Intermediates, or Paramedics. A small number of states may allow an EMT-Basic with an additional IV endorsement to start an IV, but that is an exception, not the rule.",
    "Answer": "False",
    "Confidence": 0.8
}

{
    "Reasoning": "No. 1 Court originally had no roof, but a retractable roof was completed and first used in 2019. Therefore, at present No. 1 Court at Wimbledon does indeed have a roof.",
    "Answer": "True",
    "Confidence": 0.8
}

{
    "Reasoning": "In the entire history of the NBA Playoffs, no team has ever erased a 0-3 deficit to win a best-of-seven series. The closest in the NBA Finals was the 1951 New York Knicks, who trailed 0-3, tied the series 3-3, but lost Game 7. Therefore, no team has successfully completed a comeback from 3-0 down in the NBA Finals.",
    "Answer": "False",
    "Confidence": 0.9
}

{
    "Reasoning": "Radio waves are a form of electromagnetic radiation. All electromagnetic waves—whether radio, microwaves, infrared, visible light, ultraviolet, X-rays, or gamma rays—propagate at the same fundamental speed c (~3×10^8 m/s) in a vacuum. Therefore, radio waves travel at the speed of light.",
    "Answer": "True",
    "Confidence": 0.9
}

{
    "Reasoning": "Yes. In fact, a significant portion of the 1980 U.S. Olympic ‘Miracle on Ice’ roster went on to NHL careers. Players such as Neal Broten (1,099 NHL games), Dave Christian (1,009 games), Mark Johnson, Ken Morrow, Mike Ramsey, Rob McClanahan, Bill Baker, Steve Christoff, Mark Pavelich and others all played in the National Hockey League after the Olympics.",
    "Answer": "True",
    "Confidence": 0.89
}

{
    "Reasoning": "The interior angles of any triangle sum to 180°.  If one angle is obtuse (> 90°), the other two must share the remaining < 90°, so each is individually < 90° (acute).  If one angle is right (90°), the remaining two angles must sum to 90° and each is again < 90°.  If all three are already < 90°, the statement is trivially satisfied.  Hence, every triangle necessarily contains at least two acute angles.",
    "Answer": "True",
    "Confidence": 0.9
}

{
    "Reasoning": "Baylor University is located in Waco, Texas, while the University of Mary Hardin–Baylor is in Belton, Texas. They are independent institutions with their own administrations, campuses, and athletic programs, although UMHB began historically as a female branch of Baylor before separating in the 19th century. Today they operate as two distinct universities.",
    "Answer": "False",
    "Confidence": 0.88
}

{
    "Reasoning": "In the United States, the Supreme Court decision in Roper v. Simmons (2005) held that imposing the death penalty for crimes committed while the offender was under 18 violates the Eighth Amendment’s prohibition on cruel and unusual punishment. While a few countries in the world have not formally barred such executions, they are extremely rare and widely condemned. Therefore, in the U.S.—and in almost every nation today—a person who was a minor at the time of the crime cannot legally be sentenced to death.",
    "Answer": "No",
    "Confidence": 0.77
}

{
    "Reasoning": "The Indian men’s national football team took part in the Asian qualification rounds for the 2018 FIFA World Cup but was eliminated early and therefore did not reach the final tournament held in Russia.",
    "Answer": "False",
    "Confidence": 0.93
}

{
    "Reasoning": "“T. rex” is simply the common abbreviated form of the full scientific name “Tyrannosaurus rex,” referring to the exact same dinosaur species.",
    "Answer": "True",
    "Confidence": 0.93
}

{
    "Reasoning": "The 1914-era locks (Gatún, Pedro Miguel and Miraflores) that made up the ‘old’ Panama Canal continue to operate alongside the newer, larger third-set locks that opened in 2016. The original locks are still used daily by Panamax-size vessels and smaller ships, so the old canal remains in active service.",
    "Answer": "True",
    "Confidence": 0.88
}

{
  "Reasoning": "Commercial cotton candy is made by spinning sugar that has been mixed with food coloring and a small amount of flavoring. The standard pink variety is flavored with a ‘pink vanilla’ or light strawberry-vanilla flavoring, while the standard blue variety is flavored with ‘blue raspberry.’ Because the flavorings are different, they do not taste the same, even though both are primarily just sweet spun sugar.",
  "Answer": "False",
  "Confidence": 0.73
}

{
    "Reasoning": "The 1962 film adaptation of “To Kill a Mockingbird” received eight Oscar nominations and went on to win three Academy Awards, including Best Actor for Gregory Peck. Therefore, the title did indeed win Academy Awards.",
    "Answer": "True",
    "Confidence": 0.87
}

{
    "Reasoning": "In nature, mats of vegetation, peat, and soil can detach from the shore and remain buoyant, forming ‘floating islands’ that drift on lakes or wetlands (e.g., the floating islands of Loktak Lake in India or the peat islands on Lake Titicaca). Humans have also built artificial floating islands from reeds or modern materials. Therefore, the phenomenon does exist.",
    "Answer": "True",
    "Confidence": 0.8
}

{
    "Reasoning": "Female ferrets (jills) are induced ovulators and will stay in heat until they are bred or hormonally taken out of estrus. Prolonged heat causes persistently high estrogen levels, which can lead to estrogen-induced aplastic anemia and other complications that are often fatal if not treated. While veterinary intervention (spaying or hormone injections) can prevent death, an unmated and untreated jill has a high likelihood of dying. Thus, in the common sense of the statement, it is effectively true that female ferrets can die if they don’t mate.",
    "Answer": "True",
    "Confidence": 0.75
}

{
    "Reasoning": "Xbox One supports Xbox 360 titles only through its backward-compatibility program. Microsoft had to individually adapt and license each game, so only a curated list (a bit over 600 titles) is playable. Many Xbox 360 games were never added to that list, meaning they will not run on an Xbox One.",
    "Answer": "False",
    "Confidence": 0.9
}

{
    "Reasoning": "In typical human anatomy, the aortic arch gives rise to only one brachiocephalic artery (also called the brachiocephalic trunk). This single vessel sits on the right side of the midline and then divides into the right common carotid and right subclavian arteries. On the left side, the left common carotid and left subclavian arteries arise separately and directly from the aortic arch. Therefore, there is no separate left brachiocephalic artery.",
    "Answer": "False",
    "Confidence": 0.86
}

{
    "Reasoning": "In the U.S. version of Survivor, the prize pool is tiered. The winner receives $1 million, while the runner-up (2nd place) is awarded about $100,000 (and 3rd place slightly less). All remaining finalists and even pre-jury boots receive smaller appearance stipends. Therefore, runners-up do indeed receive money even though they do not win the grand prize.",
    "Answer": "True",
    "Confidence": 0.78
}

{
    "Reasoning": "11.22.63 was produced and promoted by Hulu as a self-contained limited series adapting the entirety of Stephen King’s novel. Since its 2016 release there have been no announcements, renewals, or development reports indicating plans for more episodes, and the creative team has repeatedly stated the story is complete. Therefore the proposition that there will be a second season is almost certainly untrue.",
    "Answer": "False",
    "Confidence": 0.8
}

{
    "Reasoning": "The United States has operated commercial nuclear power reactors since the 1950s and currently has more than 90 reactors generating about 18–20 % of the nation’s electricity, so nuclear power plants definitely exist in the U.S.",
    "Answer": "True",
    "Confidence": 0.97
}

{
    "Reasoning": "Since 2022 Wimbledon follows the unified Grand-Slam rule: when the deciding set (third in women’s matches, fifth in men’s) reaches 6-6, a 10-point match-tiebreak is played. (From 2019–2021 Wimbledon already had a final-set tiebreak, but it began at 12-12.) Therefore, under the current rules there is indeed a tiebreaker in the final set at Wimbledon.",
    "Answer": "True",
    "Confidence": 0.77
}

